// Components
import Nav from './Nav';

Router.onRouteChangeStart = () => {
  NProgress.start();
};
Router.onRouteChangeComplete = () => {
  NProgress.done();
};

Router.onRouteChangeError = () => {
  NProgress.done();
};


const Header = (props) => (
  <React.Fragment>
    <img src="/grocery-bags.png" alt="Image of Grocery Bags" />
    <Nav {...props} />
  </React.Fragment>
);
export default Header;
